import React from "react";

const Images_preview = ({ Images, OnChange }) => {
  //   if (Images !== undefined) {
  console.log("Images_preview");
  console.log(Images);
  //   console.log({ Images });
  const Images_Show = Images.map(({ Element, index }) => {
    return <img key={index} className="ui mini image" src={Element} />;
  });

  //   console.log("Images_preview");
  //   console.log({ Images_Show });
  return <div>{Images_Show}</div>;
  //   }
  //   return <div></div>;
};

export default Images_preview;
